import { ListaProdutos } from "../../components/ListaProdutos";
import { Container } from "./styles";
import { dataBaseProdutos } from "../../dataBaseProdutos";
import { useSelector } from "react-redux";

const Landing = () => {
  const total = useSelector(({ cart }) => cart).reduce((acc, { quantity }) => {
    acc += quantity;
    return acc;
  }, 0);
  return (
    <Container>
      <ListaProdutos dataProdutos={dataBaseProdutos} />
    </Container>
  );
};
export { Landing };
